function ShowReadme()
	if (JustUpdated) then
		local title = Changelog.Title
		Changelog.Title = "Updated to v"..CurrentVersion
		Changelog.Callback = function() Changelog.Title = title end
		Changelog:Show()
		JustUpdated = false
		return
	end
	if (not Config.Misc.Readme) then return end
	Config.Misc.Readme = false
	Config.Misc:save()
	if (Readme.Visible or Changelog.Visible) then return end
	Readme:Show()
end
function UpdateModes()
	if (SacLoaded and Config.Orbwalker.Bind) then
		Config.Keys.Combo = _G.AutoCarry.Keys.AutoCarry
		Config.Keys.Harass = _G.AutoCarry.Keys.MixedMode
		if (Config.Keys.Combo and Target) then
			Config.Keys.Harass = false
		end
	end
end
function UpdateTarget()
	Target = Selector:GetTarget(Spells.W.Range)
	Orbwalker:ForceTarget(Target)
end
function Killsteal()
	local config = Config.Killstealing
	if (not config.Enabled or (config.RecallDisable and Recalling)) then return end
	if (not config.W and not config.E) then return end
	for _, enemy in ipairs(GetEnemiesInRange(Spells.W.Range)) do
		if (config.W and Spells.W.Ready and HaveEnoughMana(config.WMana) and Spells.W:WillKill(enemy)) then
			local castPos, hitchance = Spells.W:GetPrediction(enemy)
			if (castPos and (hitchance >= Hitchance.Medium)) then
				Spells.W:CastAt(castPos)
				break
			end
		end
		if (config.E and Spells.E.Ready and HaveEnoughMana(config.EMana) and Spells.E:WillKill(enemy)) then
			local castPos, hitchance = Spells.E:GetPrediction(enemy)
			if (castPos and (hitchance >= Hitchance.Medium)) then
				Spells.E:CastAt(castPos)
				break
			end
		end
	end
end
function PerformModes()
	if (not Target) then return end
	if (Config.Keys.Combo) then ComboMode() end
	if (Config.Keys.Harass) then HarassMode() end
end

function ComboMode()
	local config = Config.Combo
	local upgrade = config.Upgrade
	if (useR and upgrade.Q and (#GetEnemiesInRange(650) >= upgrade.QEnemies)) then
		Spells.R:Cast()
		Spells.Q:CastAt(Spells.Q:VectorOut(Target))
	elseif (config.Q and Spells.Q.Ready and HaveEnoughMana(config.QMana) and (#GetEnemiesInRange(650) > 0)) then
		Spells.Q:CastAt(Spells.Q:VectorOut(Target))
	end
	if (Spells.E:InRange(Target)) then
		local casted = false
		if (useR and upgrade.E) then
			if ((#GetEnemiesInRange(Spells.RE.Width, Target) >= upgrade.EHit) or (#GetEnemiesInRange(Spells.REStun.Width, Target) >= upgrade.EStun)) then
				local castPos, hitchance = Spells.REStun:GetPrediction(Target)
				if (castPos and (hitchance >= Hitchances[config.EHitchance])) then
					casted = true
					Spells.R:Cast()
					Spells.E:CastAt(castPos)
				end
			end
		end
		if (not casted and config.E and Spells.E.Ready and HaveEnoughMana(config.EMana)) then
			if (config.EStun) then
				Spells.EStun:PredictedCast(Target, config.EHitchance)
			else
				Spells.E:PredictedCast(Target, config.EHitchance)
			end
		end
	end
	if (Spells.W:InRange(Target)) then
		local casted = false
		if (useR and upgrade.W) then
			if (HealthUnderPercent(config.WHealth, Target) or (Spells.W:CalculateDamage(Target) * 2.2 > Target.health)) then
				local castPos, hitchance = Spells.W:GetPrediction(Target)
				if (castPos and (hitchance >= Hitchances[config.WHitchance])) then
					casted = true
					Spells.R:Cast()
					DelayAction(function() Spells.W:CastAt(castPos) end, 1.01)
				end
			end
		end
		if (not casted and config.W and Spells.W.Ready and HaveEnoughMana(config.WMana)) then
			Spells.W:PredictedCast(Target, config.WHitchance)
		end
	end
end
function HarassMode()
	local config = Config.Harass
	if (config.Q and Spells.Q.Ready and HaveEnoughMana(config.QMana) and (#GetEnemiesInRange(650) > 0)) then
		Spells.Q:CastAt(Spells.Q:VectorOut(Target))
	end
	if (config.E and Spells.E.Ready and HaveEnoughMana(config.EMana) and Spells.E:InRange(Target)) then
		if (config.EStun) then
			Spells.EStun:PredictedCast(Target, config.EHitchance)
		else
			Spells.E:PredictedCast(Target, config.EHitchance)
		end
	end
	if (config.W and Spells.W.Ready and HaveEnoughMana(config.WMana)) then
		Spells.W:PredictedCast(Target, config.WHitchance)
	end
end

